import React from "react";
import {Line} from 'react-chartjs-2';

function KnapChart(){


    var chartData= {
        labels: ["n=40000", "n=120000", "n=240000", "n=480000"],
        datasets: [{
        label: "Fractional Knapsack",
        fill: false,
        backgroundColor: 'rgb(255, 99, 132)',
        borderColor: 'rgb(255, 99, 132)',
        data: [0.001, 0.002,0.0025,0.004],
        }],

        options: {
            legend: {
              labels:{
                fontColor: "red",
                fontSize: 18
              }
            },
              scales: {
                  yAxes: [{
                      ticks: {
                        fontColor: "black",
                          beginAtZero: false
                      }
                  }],
                  xAxes: [{
                    ticks: {
                      fontColor: "black",
                      beginAtZero: false
                    }
                  }]
              }
          }
    }
    return(
        <div>
            <Line 
               data={chartData} 
            />
        </div>
    )
}

export default KnapChart;
